import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router,Route,Routes} from 'react-router-dom';
import Registeration from './Registeration';
import Login from './Login'
import Home from './Home'
import Rooms from './Rooms'


var token=JSON.parse(localStorage.getItem('token'));
ReactDOM.render(
  <Router>
  <Routes>
  <Route exact path="/" element={token===""?<Login/>:<Home/>}></Route>
      <Route path="/Registeration" element={token===""?<Registeration/>:<Home/>}></Route>
      <Route path="/Home" element={token!==""?<Home/>:<Login></Login>}></Route>
      <Route path="/Rooms" element={token!==""?<Rooms/>:<Login></Login>}></Route>
  </Routes>
  </Router>,
  document.getElementById('root')
);
